import React from 'react';

const Navbar = () => {
  return (
    <div className='navbar'>
    <div className='navbar__items'>
      <Link to='/about'>About</Link>
      <Link to='/posts'>Posts</Link>
    </div>
    </div>
  );
};

export default Navbar;
